import React from 'react';
import { Button } from '@chakra-ui/core';
import { action, actions } from '@storybook/addon-actions'

export default {
    title: 'Chakra/Button',
    component: Button,
    argTypes: {
        variantColor: {control: 'text'},
        children: {control: 'text'},
        onClick: { action: 'clicked'}
    }
}
